var numberPad = [[1,2,3], [4,5,6], [7,8,9]];
var input = [
"",
"",
"",
"",
""
];

var currIndex = {x: 1, y: 1};

_.map(input, (inputString) => {
	_.each(inputString.split(''), character => {
		switch(character) {
			case 'U':
				if (currIndex.y > 0) {
					currIndex.y -= 1;
				}
				break;
			case 'D':
				if (currIndex.y < 2) {
					currIndex.y += 1;
				}
				break;
			case 'L':
				if (currIndex.x > 0) {
					currIndex.x -= 1;
				}
				break;
			case 'R':
				if (currIndex.x < 2) {
					currIndex.x += 1;
				}
				break;
			default:
				throw(character);
		}
	});
	console.log(inputString, numberPad[currIndex.y][currIndex.x]);
});